import * as React from 'react';
import Button from '@mui/material/Button';
import { Box } from '@mui/material';
//import { useState , useEffect } from 'react';
import Paper from '@mui/material/Paper';
import { IconButton, Typography } from '@mui/material';
import LooksOneIcon from '@mui/icons-material/LooksOne';
import DeleteIcon from '@mui/icons-material/Delete';
import { useTheme } from '@mui/material/styles';


function Settings() {
  const theme = useTheme();

  return (
    <Box  >
    <Button variant="contained" disableElevation sx={{ml:130 , mb:2}} style={{backgroundColor:"orange" , color:"white"}}>
      أضف حصة
    </Button>

    <Paper  
  
  
    sx={{
      position:"relative",
      width:"940px",
      display:"flex",
      justifyContent:"space-between",
      mt:"1px",
      mb:"10px",
      pt:"15px",
      pb:"7px",
      //width: {xs:"340px",sm:"340px",md:"340px"},
      mr:{xs:"200px"},
      ml:{sm:"200px"}
    }}
    style={{backgroundColor:theme.palette.roma.main}}
   >

    <Typography sx={{ml:"16px" , fontSize:"1.3em"}} variant='h6'>
    <IconButton style={{backgroundColor:"red" , color:"white"}}> <DeleteIcon/></IconButton>
    <Button variant="contained" disableElevation sx={{ ml:"10px"}} style={{backgroundColor:"white" , color:"orange"}}>إظهار    
    
    </Button>
    <Button variant="contained" disableElevation sx={{ ml:"10px"}} style={{backgroundColor:"white" , color:"orange"}}>إخفا    
    </Button>
     <Button variant="contained" disableElevation style={{backgroundColor:"orange" , color:"white"}} sx={{ ml:"10px"}}>
تعديل   
 </Button>
     </Typography>

    <Typography
     sx={{
      mr:"35px", 
      fontSize:"1.4em",
      fontWeight:"500",
      }}
      style={{color:"black"}}
       variant='h6'>الحصه الاولي </Typography>

<IconButton 
      sx={{position:"absolute"  , right:"0" }}
      >
        <LooksOneIcon  />

      </IconButton>
    </Paper>


    <Paper  
  
  
  sx={{
    position:"relative",
    width:"940px",
    display:"flex",
    justifyContent:"space-between",
    mt:"1px",
    mb:"10px",
    pt:"15px",
    pb:"7px",
    //width: {xs:"340px",sm:"340px",md:"340px"},
    mr:{xs:"200px"},
    ml:{sm:"200px"}
  }}
  style={{backgroundColor:theme.palette.roma.main}}
 >

  <Typography sx={{ml:"16px" , fontSize:"1.3em"}} variant='h6'>
  <IconButton style={{backgroundColor:"red" , color:"white"}}> <DeleteIcon/></IconButton>
  <Button variant="contained" disableElevation sx={{ ml:"10px"}} style={{backgroundColor:"white" , color:"orange"}}>إظهار    
  
  </Button>

   <Button variant="contained" disableElevation style={{backgroundColor:"orange" , color:"white"}} sx={{ ml:"10px"}}>
تعديل   
</Button>
   </Typography>

  <Typography
   sx={{
    mr:"35px", 
    fontSize:"1.4em",
    fontWeight:"500",
    }}
    style={{color:"black"}}
     variant='h6'>الحصه الثانية</Typography>

<IconButton 
    sx={{position:"absolute"  , right:"0" }}
    >
      <LooksOneIcon  />

    </IconButton>
  </Paper>


  <Paper  
  
  
  sx={{
    position:"relative",
    width:"940px",
    display:"flex",
    justifyContent:"space-between",
    mt:"1px",
    mb:"10px",
    pt:"15px",
    pb:"7px",
    //width: {xs:"340px",sm:"340px",md:"340px"},
    mr:{xs:"200px"},
    ml:{sm:"200px"}
  }}
  style={{backgroundColor:theme.palette.roma.main}}
 >

  <Typography sx={{ml:"16px" , fontSize:"1.3em"}} variant='h6'>
  <IconButton style={{backgroundColor:"red" , color:"white"}}> <DeleteIcon/></IconButton>
  <Button variant="contained" disableElevation sx={{ ml:"10px"}} style={{backgroundColor:"white" , color:"orange"}}>إظهار    
  
  </Button>

   <Button variant="contained" disableElevation style={{backgroundColor:"orange" , color:"white"}} sx={{ ml:"10px"}}>
تعديل   
</Button>
   </Typography>

  <Typography
   sx={{
    mr:"35px", 
    fontSize:"1.4em",
    fontWeight:"500",
    }}
    style={{color:"black"}}
     variant='h6'>الحصه الثالثة</Typography>

<IconButton 
    sx={{position:"absolute"  , right:"0" }}
    >
      <LooksOneIcon  />

    </IconButton>
  </Paper>

  <Paper  
  
  
  sx={{
    position:"relative",
    width:"940px",
    display:"flex",
    justifyContent:"space-between",
    mt:"1px",
    mb:"10px",
    pt:"15px",
    pb:"7px",
    //width: {xs:"340px",sm:"340px",md:"340px"},
    mr:{xs:"200px"},
    ml:{sm:"200px"}
  }}
  style={{backgroundColor:theme.palette.roma.main}}
 >

  <Typography sx={{ml:"16px" , fontSize:"1.3em"}} variant='h6'>
  <IconButton style={{backgroundColor:"red" , color:"white"}}> <DeleteIcon/></IconButton>
  <Button variant="contained" disableElevation sx={{ ml:"10px"}} style={{backgroundColor:"white" , color:"orange"}}>إظهار    
  
  </Button>

   <Button variant="contained" disableElevation style={{backgroundColor:"orange" , color:"white"}} sx={{ ml:"10px"}}>
تعديل   
</Button>
   </Typography>

  <Typography
   sx={{
    mr:"35px", 
    fontSize:"1.4em",
    fontWeight:"500",
    }}
    style={{color:"black"}}
     variant='h6'>الحصه الرابعة</Typography>

<IconButton 
    sx={{position:"absolute"  , right:"0" }}
    >
      <LooksOneIcon  />

    </IconButton>
  </Paper>

    </Box>
  )
}

export default Settings
